DarwinOp3-v3:
  policy: 'MlpPolicy'
  normalize: "dict(norm_obs=True, norm_reward=True)"
  callback: 
    - op3.env.callbacks.TensorboardCallback
  learning_starts: 10000
  noise_type: 'normal'
  noise_std: 0.1
  train_freq: 1
  gradient_steps: 1
  learning_rate: !!float 1e-3
  batch_size: 256
  policy_kwargs: "dict(net_arch=[400, 300])"